// styles.js
export const styles = {
    bookingProcess: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        padding: '20px',
        fontFamily: 'Arial, sans-serif',
    },
    stepsIndicator: {
        display: 'flex',
        justifyContent: 'space-around',
        width: '100%',
        marginBottom: '20px',
    },
    step: {
        padding: '10px 20px',
        borderRadius: '5px',
        backgroundColor: '#e0e0e0',
        color: '#333',
    },
    activeStep: {
        backgroundColor: '#4caf50',
        color: '#fff',
    },
    roomLink: {
        textDecoration: 'none',
        color: 'grey'
    }
};
